import{_ as t,c as i,al as r,o}from"./chunks/framework.NFAqBSgQ.js";const m=JSON.parse('{"title":"Microchip pic32mz","description":"","frontmatter":{},"headers":[],"relativePath":"en/platforms/mips/pic32mz/index.md","filePath":"en/platforms/mips/pic32mz/index.md"}'),a={name:"en/platforms/mips/pic32mz/index.md"};function n(p,e,c,s,l,d){return o(),i("div",null,e[0]||(e[0]=[r('<h1 id="microchip-pic32mz" tabindex="-1">Microchip pic32mz <a class="header-anchor" href="#microchip-pic32mz" aria-label="Permalink to &quot;Microchip pic32mz&quot;">​</a></h1><h2 id="microchip-pic32mzef" tabindex="-1">Microchip PIC32MZEF <a class="header-anchor" href="#microchip-pic32mzef" aria-label="Permalink to &quot;Microchip PIC32MZEF&quot;">​</a></h2><p>(MIPS M5150 architecture).</p><p>A port is in available for the MikroElectronika <a href="https://www.mikroe.com/flipclick-pic32mz" target="_blank" rel="noreferrer">Flip&amp;Click PIC32MZ</a> development board based on the PIC32MZ2048EFH100 MCU. This board configuration was added in NuttX-7.24 and is, for the most part, compatible with the PIC32MZEC family.</p><p><strong>STATUS:</strong></p><p><strong>NuttX-7.9</strong>. The first official release was in NuttX-7.9. Many drivers port simply from the PIC32MX; others require more extensive efforts. Driver status as of (2015-03-29) is provided below:</p><ul><li>I/O ports include I/O port interrupts</li><li>UART serial driver that provides the NSH console,</li><li>Timer,</li><li>I2C (untested),</li><li>SPI (untested),</li><li>On-board buttons and LEDs,</li><li>Ethernet (code complete, but not yet functional),</li></ul><p><strong>NuttX-7.29</strong>. Abdelatif Guettouche contributed additional timer support including: Timer lower half driver, free-running, and one-shot timers.</p><p><strong>NuttX-7.31</strong>. Abdelatif Guettouche contributed DMA support.</p><p><strong>NuttX-9.0</strong>. Cache operations were implemented.</p><p>Refer to the NuttX board <a href="https://github.com/apache/nuttx/blob/master/Documentation/platforms/mips/pic32mz/boards/pic32mz-starterkit/README.txt" target="_blank" rel="noreferrer">README</a> file for further information.</p><p><strong>Development Environment:</strong> Same as for the PIC32MZ.</p><h2 id="microchip-pic32mzec" tabindex="-1">Microchip PIC32MZEC <a class="header-anchor" href="#microchip-pic32mzec" aria-label="Permalink to &quot;Microchip PIC32MZEC&quot;">​</a></h2><p>PIC32MZEC Family (MIPS microAptiv). A port is in available for the PIC32MZ Embedded Connectivity (EC) Starter Kit. There are two configurations of the Microchip PIC32MZ EC Starter Kit:</p><ol><li>The PIC32MZ Embedded Connectivity Starter Kit based on the PIC32MZ2048ECH144-I/PH chip (DM320006), and</li><li>The PIC32MZ Embedded Connectivity Starter Kit based on the PIC32MZ2048ECM144-I/PH w/Crypto Engine (DM320006-C).</li></ol><p>See the <a href="http://www.microchip.com" target="_blank" rel="noreferrer">Microchip</a> website for further information.</p><p>This was a collaborative effort between Kristopher Tate, David Sidrane and myself. The basic port is functional and a NuttShell (NSH) configuration is available.</p><h3 id="supported-boards" tabindex="-1">Supported Boards <a class="header-anchor" href="#supported-boards" aria-label="Permalink to &quot;Supported Boards&quot;">​</a></h3><blockquote><p>boards/<em>/</em></p></blockquote>',19)]))}const f=t(a,[["render",n]]);export{m as __pageData,f as default};
